/*****************************
Category Code: MODEL_YEAR_MAP
Category Name: Model and Year Of Manufacture Map
******************************/

CREATE PROCEDURE GEN_MODEL_YEAR_MAP_DATA
   LANGUAGE SQL
BEGIN
		FOR model AS
			SELECT entry_code, ref_entry_code FROM common_code_category_entry
			 WHERE category_code = 'MODEL'
		DO
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '1999', '1999', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2000', '2000', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2001', '2001', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2002', '2002', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2003', '2003', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2004', '2004', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2005', '2005', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--

			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2006', '2006', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2007', '2007', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
			  
			SELECT NEXT VALUE FOR common_code_category_entry_seq, '2008', '2008', '1', 'MY', 'ARBS', category_code, category_id, model.ref_entry_code || '|' || model.entry_code
			  FROM common_code_category WHERE category_code = 'MODEL_YEAR_MAP';--
		END FOR;--
END;

CALL GEN_MODEL_YEAR_MAP_DATA;

DROP PROCEDURE GEN_MODEL_YEAR_MAP_DATA;

